import './FootBarStyle.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCoffee } from '@fortawesome/free-solid-svg-icons';

function FootBar(){

    return(
        
        <div className='footer'>
            <div className="media-icons">
                         <a href="https://github.com/Dhanush-Karthik"><FontAwesomeIcon icon={faCoffee}/></a>
                         <a href="https://www.linkedin.com/in/dhanush-karthik-348a741bb"><i className="fab fa-linkedin"></i></a>
                         <a href="https://www.facebook.com/profile.php?id=100006168917057"><i className="fab fa-facebook"></i></a>
                         <a href="https://twitter.com/Dhanushdk45"><i className="fab fa-twitter"></i></a>
                         <a href="https://www.instagram.com/_._dk7_._/"><i className="bi bi-instagram"></i></a>
                </div>
        </div>
    );
}

export default FootBar;
